import React, { Component } from 'react';

class Video extends Component {
    render() {
        const { id, title, channel, image, ...rest } = this.props;
        return (
            <div key={rest.id} className="next-video__item">
                <div className="next-video__left">
                    <img className="next-video__video" src={rest.image} alt="" />
                </div>
                <div className="next-video__right">
                    <span>
                        <h4 className="next-video__title">{rest.title}</h4>
                    </span>
                    <span>
                        <h4>{rest.channel}</h4>
                    </span>
                </div>
            </div>
        );
    }
}

export default Video;
